import './Footer.css';
import { useNavigate } from 'react-router-dom';

function Footer() {
  const navigate = useNavigate();
  const handleContact = () => {
    navigate('/');
  };
  return (
    <>
      <div className='footer'>
        <p>@2024 ProjectVault. All Right Reserved</p>
        <div>
            <button className='footer-buttons' onClick={handleContact}>contact</button>
            <button className='footer-buttons'>privacy</button>
            <button className='footer-buttons'>about</button>
            <button className='footer-buttons'>terms & conditions</button>
        </div>
      </div>
    </>
  );
}

export default Footer;
